// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Blog {
  constructor()  {}

  struct Post {
    uint256 id;
    string title;
    string content;
    uint256 timestamp;
    address author;
  }

  Post[] public posts;
  uint256 public postCount;

  function createPost(string memory _title, string memory _content) public {
    posts.push(Post({
      id: postCount + 1,
      title: _title,
      content: _content,
      timestamp: block.timestamp,
      author: msg.sender
    }));
    postCount++;
  }

  function getPosts() public view returns (Post[] memory) {
    return posts;
  }

  function getPost(uint256 _index) public view returns (Post memory) {
    return posts[_index];
  }

  function getPostsByAuthor(address _author) public view returns (Post[] memory) {
    Post[] memory _posts = new Post[](posts.length);
    uint256 count = 0;
    for (uint i = 0; i < posts.length; i++) {
      if (posts[i].author == _author) {
        _posts[count] = posts[i];
        count++;
      }
    }
    return _posts;
  }
}
